import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./Home";
import "./Feed.css";
import Tasklist from "../Activity1/frontend/src/Tasklist";
import ActivityApp from "../Activity2/frontend/src/App";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/activity1" element={<Tasklist />} />
        <Route path="/activity2" element={<ActivityApp />} />
      </Routes>
    </Router>
  );
}

export default App;
